package com.money.project.system.domain;import com.money.framework.aspectj.lang.annotation.Excel;import com.money.framework.web.domain.BaseEntity;import org.apache.commons.lang3.builder.ToStringBuilder;import org.apache.commons.lang3.builder.ToStringStyle;import javax.validation.constraints.NotBlank;import javax.validation.constraints.Size;public class SysConfig extends BaseEntity{    private static final long serialVersionUID = 1L;    @Excel(name = "configId", cellType = Excel.ColumnType.NUMERIC)    private Long configId;    @Excel(name = "configName")    private String configName;    @Excel(name = "configKey")    private String configKey;    /** 参数键值 */    @Excel(name = "configValue")    private String configValue;    /** 系统内置（Y是 N否） */    @Excel(name = "configType", readConverterExp = "Y=YES,N=NO")    private String configType;    public Long getConfigId()    {        return configId;    }    public void setConfigId(Long configId)    {        this.configId = configId;    }    @NotBlank(message = "Parameter name cannot be empty")    @Size(min = 0, max = 100, message = "Parameter names cannot exceed 100 characters")    public String getConfigName()    {        return configName;    }    public void setConfigName(String configName)    {        this.configName = configName;    }    @NotBlank(message = "The length of the parameter key name cannot be empty")    @Size(min = 0, max = 100, message = "The length of the parameter key name cannot exceed 100 characters")    public String getConfigKey()    {        return configKey;    }    public void setConfigKey(String configKey)    {        this.configKey = configKey;    }    @NotBlank(message = "Parameter key value cannot be empty")    @Size(min = 0, max = 500, message = "The length of the parameter key value cannot exceed 500 characters")    public String getConfigValue()    {        return configValue;    }    public void setConfigValue(String configValue)    {        this.configValue = configValue;    }    public String getConfigType()    {        return configType;    }    public void setConfigType(String configType)    {        this.configType = configType;    }        @Override    public String toString() {        return new ToStringBuilder(this,ToStringStyle.MULTI_LINE_STYLE)            .append("configId", getConfigId())            .append("configName", getConfigName())            .append("configKey", getConfigKey())            .append("configValue", getConfigValue())            .append("configType", getConfigType())            .append("createBy", getCreateBy())            .append("createTime", getCreateTime())            .append("updateBy", getUpdateBy())            .append("updateTime", getUpdateTime())            .append("remark", getRemark())            .toString();    }}